window.bookSummaryJSON = "<p>The [System] was intended to be humanity’s salvation. But it turned out to be a double-edged sword that could just as easily lead to its destruction.</p> <p>Following a series of thankfully successful efforts in Europe, Isaac travels overseas to show the world new ways of leveling, gather new allies, and gain power in the dungeons that have cropped up.</p> <p>The whole affair would be perfectly doable, if it weren’t for the cult trying to destroy his work, the looming threat of another [System] Event, and the ever-present danger of humanity’s darkest aspects and the monsters they spawn.</p> <p>Will humanity stand proud and stop the first demons to emerge in this new timeline or be swept away in a flood of hellfire?</p>"; 
